            </div>
            <div class = "shopLinks">
            <div class = "itemLink">
                <p class = "linktitle"> Totes</p>
                <a href = "totes.html"><img class = "productPicture" src={require("./images/lemontote.jpg")}/></a>
            </div>
            <div class = "itemLink">
                <p class = "linktitle">Stickers</p>
                <a href = "./Stickers"><img class = "productPicture" src={require("./images/peachSticker.jpg")}/></a>
            </div>
            </div>
            <Footer/>
        </div>
        )
};

export default Shop;
